import RajasthanDes from "../../images/RajasthanDes.jpg";
import Rajasthan from "../../images/Rajasthan.jpg";
import "../dropdown.css";
import { Row, Col } from "react-bootstrap";
import BCard from "react-bootstrap/Card";
import * as FaIcons from "react-icons/fa";
import { FaUserAlt } from "react-icons/fa";

export default function Destination() {
  return (
    <>
      <div>
        <img className="DestImage" src={RajasthanDes} alt="raj"></img>
      </div>
      <Row>
        <Col>Text</Col>
        <Col xs={12} lg={3} md={6} className="m-1 p-2 pl-5 card_style">
          <BCard.Img variant="top" src={Rajasthan} />
          <BCard style={{ width: "20rem" }}>
            <BCard.Body>
              <BCard.Text>
                Sad of or ancient earthly and long. Him would deem or now
                hellas, yet there in of since tis sighed, chaste as him nor
                girls..ium
              </BCard.Text>
            </BCard.Body>
            <Col className="mb-4"></Col>
          </BCard>
        </Col>
      </Row>
    </>
  );
}
